import React from 'react';
import {Link} from 'react-router-dom';

const data = [
    {
        label : 'HOME',
        to : '/'
    },

    {
        label : 'ABOUT',
        to : '/about'
    },

    {
        label : 'EXPERIENCE',
        to : '/experience'
    },

    {
        label : 'PROJECTS',
        to : '/projects'
    },

    {
        label : 'CONTACT',
        to : '/contact'
    },
]

